  constructor(props) {
    super(props);

    this.state2 = {
      options: {},
      series: [44, 55, 41, 17, 15],
      labels: ["A", "B", "C", "D", "E"]
    };

    this.state = {
      options: {
        chart: {
          id: "basic-bar"
        },
        xaxis: {
          categories: [1991, 1992, 1993, 1994, 1995, 1996, 1997, 1998]
        }
      },
      series: [
        {
          name: "series-1",
          data: [30, 40, 45, 50, 49, 60, 70, 91]
        }
      ]
    };
  }

  render() {
    return (
      <div className="app">
        <div className="row">
          <div className="mixed-chart">
            {/* <Column props={this.state} />
            <Graph props={this.state} /> */}
            <div className="donut">
              <Donut props={this.state2} />
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
